 Here's a TypeScript function that takes first name and last name as arguments and returns the full name:
```typescript
function fullName(firstName: string, lastName: string): string {
  return `${firstName} ${lastName}`;
}
```
You can call this function with the first and last names as arguments, like this:
```typescript
const firstName = "John";
const lastName = "Doe";
const fullName = fullName(firstName, lastName);

console.log(fullName); // Output: "John Do
